import React from "react";
import UseYoutubeVideo from "../utils/useYoutubeVideo";
import { useParams } from "react-router-dom";
import { addToWatchLater } from "../utils/WatchLater";
import { useDispatch } from "react-redux";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";

const Playvideo = () => {
  const { id } = useParams();
  const video = UseYoutubeVideo(id);
  const [dropdownStates, setDropdownStates] = useState({});
  const [data, setData] = useState([]);
  const [inputvalue, setinputValue] = useState("");
  const [vidid, setVidId] = useState();


  const toggleDropdown = (videoid) => {
    setDropdownStates((prevStates) => ({
      ...prevStates,
      [videoid]: !prevStates[videoid],
    }));
    setVidId(videoid);
  };

  const videoitem = video[0];
  console.log(videoitem);
  console.log(vidid);

  const handleInputChange = (e) => {
    setinputValue(e.target.value);
  };

  useEffect(() => {
    const storedData = JSON.parse(localStorage.getItem("playlists")) || [];
    setData(storedData);
  }, []);

  const handleFormSubmit = (e) => {
    e.preventDefault();
    const newPlaylist = { Playlist: inputvalue, id: Date.now(), videos: [] };
    setData((prevData) => [...prevData, newPlaylist]);
    setinputValue("");
    const storedData = JSON.parse(localStorage.getItem("playlists")) || [];
    localStorage.setItem(
      "playlists",
      JSON.stringify([...storedData, newPlaylist])
    );
  };

  console.log(dropdownStates);

  const addtothisPlaylist = (playlistName) => {
    const updatedData = data.map((item) =>
      item.Playlist === playlistName
        ? { ...item, videos: [...item.videos, {vidid}] } : item
    );
    localStorage.setItem("playlists", JSON.stringify(updatedData));
    setData(updatedData);
  };

  const dispatch = useDispatch();

  const add = () => {
    dispatch(addToWatchLater(videoitem));
  };

  useEffect(() => {
    const storedData = JSON.parse(localStorage.getItem("playlists")) || [];
    setData(storedData);
  }, []);

  // console.log(data);

  return (
    <>
      <div>
        <iframe
          className="max-w-full max-h-screen border-2"
          style={{ height: "700px", width: "1000px" }}
          src={videoitem?.Videolink}
        ></iframe>
        <div className="flex">
          <h1>{videoitem?.snippet?.title}</h1>
          <div className="flex gap-4">
            <button className="bg-gray-300 p-2" onClick={() => add(videoitem)}>
              Watch later
            </button>
            <div className="relative inline-block text-left">
              <button
                type="button"
                onClick={() => toggleDropdown(videoitem?.id)}
                className="inline-flex items-center px-4 py-2 border border-gray-300 rounded-md bg-gray-100 text-sm font-medium text-gray-700 hover:bg-gray-200 focus:outline-none focus:ring focus:border-blue-300"
              >
                Add_To_Playlist
                <svg
                  className="-mr-1 ml-2 h-5 w-5"
                  xmlns="http://www.w3.org/2000/svg"
                  viewBox="0 0 20 20"
                  fill="currentColor"
                >
                  <path
                    fillRule="evenodd"
                    d="M10 12l-1 1-4-4 1-1.5L10 9l4-4 1 1z"
                    clipRule="evenodd"
                  />
                </svg>
              </button>
              {dropdownStates[videoitem?.id] && (
                <div className="origin-top-right absolute right-0 mt-2 w-52 h-60 rounded-md shadow-lg bg-white ring-1 ring-black ring-opacity-5">
                  <button
                    className="bg-gray-300 w-full p-2"
                    onClick={() => add()}
                  >
                    Watch later
                  </button>
                  <div>
                    <ul>
                      {data.map((item) => (
                        <div className="" key={item.id}>
                          {/* <Link to={"/playlist/" + item.id}> */}
                          <button
                            onClick={() => addtothisPlaylist(item.Playlist)}
                            className="p-2 text-white bg-gray-800 mt-2 w-full"
                            key={item.id}
                            >
                            {item.Playlist}
                          </button>
                            {/* </Link> */}
                        </div>
                      ))}
                    </ul>
                  </div>
                  <div className="mt-10 flex">
                    <input
                      className="w-40 border-0"
                      placeholder="+...Create New Playlist"
                      type="text"
                      value={inputvalue}
                      onChange={handleInputChange}
                    ></input>
                    <button className="bg-green-400" onClick={handleFormSubmit}>
                      Create
                    </button>
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Playvideo;
